import React from 'react'
import styled from 'styled-components';

const BigButton = styled.button`
  color: #FFC759;
  font-size: 12px;
  font-weight: medium;
  &:hover {
      text-decoration: none;
      color: #FFC759;
  }
`;

const Button = () => {
         return <BigButton></BigButton>
}

export default Button;
